import React from "react";

function Product(data){
    return (
        <div>
            <img src={data.photo}/>
      
       <div className="bg-red-300 text-amber-900 text-lg">{data.title} {data.caregory}</div> 

       <div className="bg-gray-600 text-white">{data.caregory} </div>
       </div>
    );
}

export default Product;
